// mockData.js
const mockContacts = [
    { id: 1, fullName: "Иван Иванов", phone: "+79998887766", notes: "Коллега" },
    {
        id: 2,
        fullName: "Анна Смирнова",
        phone: "+79998887755",
        notes: "Подруга",
    },
    { id: 3, fullName: "Петр Петров", phone: "+79998887744", notes: "Сосед" },
];

